import './App.css';
import Particles from "react-tsparticles";
import { loadFull } from 'tsparticles';
import { Routes, Route } from 'react-router-dom';
import Home from './containers/home';
import About from './containers/about';
import Contact from './containers/contact';
import Projects from './containers/projects';
import Navbar from './components/navbar';
import { particlesConfig } from './utils/particles'; // Ensure correct import for particlesConfig

function App() {
    const particlesInit = async (main) => { // Match the name here
        await loadFull(main);
    };

    return (
        <div className="App">
            {/* Particles Background */}
            <Particles
                id="tsparticles"
                init={particlesInit} // Pass the correct particlesInit function
                options={particlesConfig} // Pass the imported particlesConfig
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%",
                    zIndex: -1,
                }}
            />

            {/* Navbar and Routes */}
            <Navbar />
            <Routes>
                <Route path='/' element={<Home />} />
                <Route path='/about' element={<About />} />
                <Route path='/projects' element={<Projects />} />
                <Route path='/contact' element={<Contact />} />
            </Routes>
        </div>
    );
}

export default App;
